  console.log("this is data in all voters componet ---->",allVotersdata);

  useEffect(() => {
    dispatch(fetchAllVotersAction());
    console.log('Im touched..!')
  }, [dispatch]);

  return (
    <div style={{margiTop:'200px', border:'2px solid red'}}>
    {allVotersdata.map((item) => {
      <h1>{item.voter_name}</h1>
    })}
    </div>
  );
};

export default AllDataComponent;
